/* eslint-disable max-len */
const BlockType = require('../extension-support/block-type');
const ArgumentType = require('../extension-support/argument-type');
// const bs58 = require('bs58');
// const token = require('@solana/spl-token');
// const web3 = require('@solana/web3.js');

// eslint-disable-next-line max-len
const heliusIconURI = 'data:image/png;base64,';
// eslint-disable-next-line max-len
const MenuiconURI = `data:image/png;base64,`;

class Helius {
    static apiKey = '';
    constructor (runtime) {
        /**
         * The runtime instantiating this block package.
         * @type {Runtime}
         */
        this.runtime = runtime;
    }

    /**
     * @returns {object} metadata for this extension and its blocks.
     */
    getInfo () {
        return {
            id: 'helius',
            name: 'Helius',
            color1: '#e4552e',
            color2: '#e4552e',
            menuIconURI: MenuiconURI,
            blocks: [
                {
                    opcode: 'setApi',
                    blockType: BlockType.COMMAND,
                    text: '[HELIUS] Set Helius API to [api]',
                    arguments: {
                        api: {
                            type: ArgumentType.STRING,
                            defaultValue: 'API Key'
                        },
                        HELIUS: {
                            type: ArgumentType.IMAGE,
                            dataURI: heliusIconURI
                        }
                    }
                },

                {
                    opcode: 'getAssets',
                    blockType: BlockType.REPORTER,
                    text: '[HELIUS] Get assets by owner [publicKey] with limit [limit]',
                    arguments: {
                        publicKey: {
                            type: ArgumentType.STRING,
                            defaultValue: 'Public Key'
                        },
                        limit: {
                            type: ArgumentType.NUMBER,
                            defaultValue: 3
                        },
                        HELIUS: {
                            type: ArgumentType.IMAGE,
                            dataURI: heliusIconURI
                        }
                    }
                },

                {
                    opcode: 'parseTransaction',
                    blockType: BlockType.REPORTER,
                    text: '[HELIUS] Parse [transaction] using the Helius Enhanced Transactions API ',
                    arguments: {
                        transaction: {
                            type: ArgumentType.STRING,
                            defaultValue: 'Transaction ID'
                        },
                        HELIUS: {
                            type: ArgumentType.IMAGE,
                            dataURI: heliusIconURI
                        }
                    }
                }

            ],
            menus: {
                networks: {
                    acceptReporters: true,
                    items: ['mainnet-beta', 'devnet', 'testnet']
                }
            }
        };
    }

    setApi (args) {
        const api = args.api;
        Helius.apiKey = api;
    }

    async getAssets (args) {
        const publicKey = args.publicKey;
        const limit = args.limit;
        try {
            const url = `https://mainnet.helius-rpc.com/?api-key=${Helius.apiKey}`;
        
            const response = await fetch(url, {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json'
                },
                body: JSON.stringify({
                    jsonrpc: '2.0',
                    id: 'get-assets',
                    method: 'getAssetsByOwner',
                    params: {
                        ownerAddress: publicKey,
                        page: 3,
                        limit: limit,
                        displayOptions: {
                            showFungible: true
                        }
                    }
                })
            });
        
            if (!response.ok) {
                throw new Error(
                    `Failed to fetch: ${response.status} - ${response.statusText}`
                );
            }
        
            const data = await response.json();
        
            return data.result.items;
        } catch (error) {
            console.error('Error retrieving assets: ', error.message);
            throw new Error(`Assets retrieval failed: ${error.message}`);
        }
    }

    async parseTransaction (args) {
        const tid = args.transaction;
        try {
            const url = `https://api.helius.xyz/v0/transactions/?api-key=${Helius.apiKey}`;
        
            const response = await fetch(url, {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json'
                },
                body: JSON.stringify({
                    transactions: [tid]
                })
            });
        
            if (!response.ok) {
                throw new Error(
                    `Failed to fetch: ${response.status} - ${response.statusText}`
                );
            }
            const data = await response.json();
            return data;
        } catch (error) {
            console.error('Error parsing transaction: ', error.message);
            throw new Error(`Transaction parsing failed: ${error.message}`);
        }
    }
}

module.exports = Helius;
